function sendResult(resultText) {
    postMessage({
        'type': 'result',
        'resultText': resultText
    });
}
function sendStatus(statusText) {
    postMessage({
        'type': 'status',
        'statusText': statusText
    });
}
var runtime;
function initializeRuntime () {
    function builtinRead(x) {
      if (Sk.builtinFiles === undefined || Sk.builtinFiles["files"][x] === undefined)
        throw "File not found: '" + x + "'";
      return Sk.builtinFiles["files"][x];
    }

    function printOutput(s) {
      sendResult(s);
      sendStatus('done');
    }
    Sk.configure({output: printOutput, read: builtinRead});
    // enable run buttons
    sendStatus('done');
}
initializeRuntime();
this.onmessage = function (event) {
  var messageType = event.data.type;
  switch (messageType) {
    case ('execute'):
      var input = event.data.value;
      if (input.indexOf('print') == -1) {
        // insert print before the last statement
        var lines = input.split('\n');
        for (var i = lines.length - 1; i >= -1; i--) {
          if (i === -1) {
            sendStatus('done');
            return;
          }
          // trim leading whitespace
          // split line by comment sign
          lineSegments = lines[i].trim().split('#');
          // '#'.split('#') >>> ["", ""]
          // if there is content before comment sign
          if (lineSegments[0]) { // split always returns a non-empty array
            // add "print " and break
            lines[i] = lines[i].replace(lineSegments[0], 'print ' + lineSegments[0]);
            break;
          }
        }
        input = lines.join('\n');
      }
      sendStatus('starting');

      Sk.importMainWithBody("<stdin>", false, input, true);
      break;
    case ('reset'):
      initializeRuntime();
      break;
    default:
      break;
  }
};
